class Solution:
    def characterReplacement(self, s: str, k: int) -> int:
        n = len(s)
        if n < 2:
            return n

        l, ans, maxCount, initialValue, cache = 0, 0, 0, ord("A"), [0] * 26
        for r in range(n):
            rightIndex = ord(s[r]) - initialValue
            cache[rightIndex] += 1
            maxCount = max(maxCount, cache[rightIndex])

            if r - l + 1 - maxCount > k:
                leftIndex = ord(s[l]) - initialValue
                cache[leftIndex] -= 1
                l += 1

            ans = max(ans, r - l + 1)
        return ans


# 2
print(Solution().characterReplacement(s="AABA", k=0))

# 4
print(Solution().characterReplacement(s="AABABBA", k=1))

# 4
print(Solution().characterReplacement(s="ABAB", k=2))

# 下面的算法没问题，但是过于繁琐：
#
# - 最短的字符串长度是 k + 1，即随意变更 k 个字符与那一个字符相同
# - 特判 k >= len(s) - 1 时，返回 len(s)
# - 先设置缓存为 26 个 0 的数组，用于存储滑动窗口中各个值的个数
# - 循环添加元素到缓存中，直到等于 k + 1 个时停止
# - 判断此时除去最多的元素外，其余元素的数量总和是否小于等于 k
#   - 小于等于 k 则执行操作后，可以做到字符全部相同
#   - 大于 k 则不可以做到全部相同
# - 需要从开始滑动到末尾，算作一次完整的判断
# - 从数量 k + 1 一直增加，最后一次是全部的字符
#   - 如果出现了失败，则表示后续更长的字符都不符合，不用判断了

# 10000
print(
    Solution().characterReplacement(
        s="",
        k=5135,
    )
)

# 5526
print(
    Solution().characterReplacement(
        s="",
        k=4567,
    )
)
